import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg p-4">
      <div className="container">
        <div className="navRow row d-flex justify-content-center">
        <a className="navbar-brand" href="/">
        <h1>Peoples with Meeples</h1>
        </a>
        </div>
        <br></br>
        <br></br>
        <div className="navRow links row d-flex justify-content-center">
          <a href="/" className="link">Home</a>
          <a href="/signup" className="link">Sign Up</a>
          <a href="/login" className="link">Log In</a>
          <a href="/profile" className="link">Profile</a>
          <a href="/guild" className="link">Guild</a>
          <a href="/search"className="link">Search</a>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
